                <div class="t m0 x2 hb y59 ff1 fs5 fc1 sc1 ls0 ws0">契約条項</div>
                <div class="t m0 x2 hb y5a ff1 fs5 fc1 sc0 ls0 ws0">第1条󲘬󲘬󲘬󲘬󲘬󲘬󲘬 （契約の目的・成立）　</div>
                <div class="t m0 x2a hb y5b ff1 fs5 fc1 sc0 ls0 ws0">甲は乙に対し本件自動車を前記契約内容の約定により売渡を行い、乙はこれを買受ける。</div>
                <div class="t m0 x2 hb y5c ff1 fs5 fc1 sc0 ls0 ws0">第2条󲘬󲘬󲘬󲘬󲘬󲘬󲘬 （所有権移転時期）　</div>
                <div class="t m0 x2a hb y5d ff1 fs5 fc1 sc0 ls0 ws0">本件自動車の所有権は、乙が本件自動車の名義変更を完了完了させた時点で󲘬甲から乙に移転する。</div>
                <div class="t m0 x2 hb y5e ff1 fs5 fc1 sc0 ls0 ws0">第3条󲘬󲘬󲘬󲘬󲘬󲘬󲘬 （名義変更）　</div>
                <div class="t m0 x2a hb y5f ff1 fs5 fc1 sc0 ls0 ws0">乙は本契約締結後速やかに名義変更手続きを行い、名義を変更する。</div>
                <div class="t m0 x2 hb y60 ff1 fs5 fc1 sc0 ls0 ws0">第4条 （契約解除）　</div>
                <div class="t m0 x2a hb y61 ff1 fs5 fc1 sc0 ls0 ws0">本件自動車の名義変更完了後は、別途定める場合を除き、甲乙のいずれも本契約を解除することはできない󲘬。</div>
                <div class="t m0 x2 hb y62 ff1 fs5 fc1 sc0 ls0 ws0">第5条󲘬󲘬󲘬󲘬󲘬󲘬󲘬 （引渡し後の自己責任）　</div>
                <div class="t m0 x2a hb y63 ff1 fs5 fc1 sc0 ls0 ws0">本件自動車の引渡し後の事故等においては、乙の責任において<span class="_ _0"></span>すべて処理し、乙は甲に一切の迷惑をかけないものとする。</div>
                <div class="t m0 x2 hb y64 ff1 fs5 fc1 sc0 ls0 ws0">第6条󲘬󲘬󲘬󲘬󲘬󲘬󲘬 （瑕疵担保）󲘬　</div>
                <div class="t m0 x2a hb y65 ff1 fs5 fc1 sc0 ls0 ws0">1. 本件自動車の瑕疵担保期間は本件自動車の引渡し後3日以内とし、</div>
                <div class="t m0 x2a hb y66 ff1 fs5 fc1 sc0 ls0 ws0"> この間に乙の責任とはならない瑕疵が発見された<span class="_ _0"></span>場合は、甲の責任においてこれを修理するものとする󲘬。 </div>
                <div class="t m0 x2a hb y67 ff1 fs5 fc1 sc0 ls0 ws0">2. 前項の瑕疵の存在によって本契約の目的を達することができない場合には、乙は本契約を解除す<span class="_ _0"></span>ることができるものとする。</div>
                <div class="t m0 x2a hb y68 ff1 fs5 fc1 sc0 ls0 ws0">3. 甲の乙に対する前2項の責任は、第1項に定める期間に限られ、以後甲は乙に対し何ら責任を負わないものとする。</div>
                <div class="t m0 x2 hb y69 ff1 fs5 fc1 sc0 ls0 ws0">第７条　 　（丙に対する委任）　</div>
                <div class="t m0 x2a hb y6a ff1 fs5 fc1 sc0 ls0 ws0">甲および乙は、本契約の履行に関してそれぞれ丙に諸手続きを委任するものとする。</div>
                <div class="t m0 x2 h3 y6b ff1 fs1 fc1 sc0 ls0 ws0">第8条　　　（協議・紛争解決）</div>
                <div class="t m0 x2a hb y6c ff1 fs5 fc1 sc0 ls0 ws0">1. 本契約に定めのない事項または本契約に関して紛争が生じた<span class="_ _0"></span>場合には、民法その他の法規の従い甲乙誠意をもって協議解決するものとする。</div>
                <div class="t m0 x2a hb y6d ff1 fs5 fc1 sc0 ls0 ws0">2．前項の協議が不調となった場合など、本契約に関する紛争については、</div>
                <div class="t m0 x2a hb y6e ff1 fs5 fc1 sc0 ls0 ws0"> 甲乙の居住地を管轄する簡易裁判所または地方裁判所を第一審の専属的合意管轄裁判所として解決するものとする。</div>
                <div class="t m0 x2 h3 y6f ff1 fs1 fc1 sc0 ls0 ws0">第9条 　　　（SHIFTG<span class="_ _0"></span>ATE利用規約の適用）</div>
                <div class="t m0 x2a h3 y70 ff1 fs1 fc1 sc0 ls0 ws0">甲および乙は、本契約条項に定めるもののほか、S<span class="_ _0"></span>HIFTGATE利用規約の定めにそれぞれ従うも<span class="_ _0"></span>のとする。</div>
